INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 2, 1, 0, 1, 1, 0.0, 1, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", "vo_minigame_1012_result_1080", 5, 12300148);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 2, 2, 0, 8, 1, 2.21, 1, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", "vo_minigame_1012_result_1081", 5, 12300149);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 2, 2, 0, 3, 1, 2.46, 1, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", "vo_minigame_1012_result_1082", 5, 12300150);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 2, 2, 0, 3, 1, 2.94, 1, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", "vo_minigame_1012_result_1083", 5, 12300151);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 2, 3, 0, 7, 1, 4.19, 1, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", "vo_minigame_1012_result_1084", 5, 12300152);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 2, 3, 0, 1, 1, 0.0, 1, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", "vo_minigame_1012_result_1085", 5, 12300153);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 9, 2, 3, 0, 3, 1, 2.63, 1, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", "vo_minigame_1012_result_1086", 5, 12300154);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 2, 1, 0, 3, 1, 5.53, 1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", "vo_minigame_1012_result_1087", 1, 12300155);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 2, 1, 9, 3, 1, 0.01, 3, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", "vo_minigame_1012_result_1088", 1, 12300156);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 2, 1, 3, 3, 1, 4.15, 1, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", "vo_minigame_1012_result_1089", 1, 12300157);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 2, 2, 9, 9, 1, 0.01, 9, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", "vo_minigame_1012_result_1090", 1, 12300158);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 2, 2, 0, 3, 1, 5.37, 1, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", "vo_minigame_1012_result_1091", 1, 12300159);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 2, 2, 0, 3, 1, 1.44, 1, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", "vo_minigame_1012_result_1092", 1, 12300160);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 2, 3, 0, 3, 1, 0.0, 3, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", "vo_minigame_1012_result_1093", 1, 12300161);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 2, 3, 3, 3, 1, 2.91, 9, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", "vo_minigame_1012_result_1094", 1, 12300162);
