INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 2, 2, 3, 4, 2, 4.29, 10, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", "vo_minigame_1012_result_2092", 1, 22300160);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 2, 3, 6, 4, 2, 4.64, 8, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", "vo_minigame_1012_result_2093", 1, 22300161);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 2, 3, 0, 9, 2, 3.14, 5, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", "vo_minigame_1012_result_2094", 1, 22300162);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 4, 2, 3, 0, 7, 2, 6.59, 4, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", "vo_minigame_1012_result_2095", 1, 22300163);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 0, 2, 1, 0, 3, 2, 0.0, 3, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", "vo_minigame_1012_result_2096", 0, 22300164);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 0, 2, 1, 5, 9, 2, 2.2, 10, "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？", "vo_minigame_1012_result_2097", 0, 22300165);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 0, 2, 1, 6, 4, 2, 0.01, 4, "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？", "vo_minigame_1012_result_2098", 0, 22300166);
