INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 0, 2, 2, 6, 9, 2, 3.22, 4, "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変", "vo_minigame_1012_result_2100", 0, 22300168);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 0, 2, 2, 11, 4, 2, 2.1, 0, "０点だね…\nでも、へーきへーき\nリベンジしたら、結果オーライ！", "vo_minigame_1012_result_2101", 0, 22300169);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (3001, 0, 2, 3, 3, 0, 2, 2.74, 2, "おやつ休憩して\nリベンジしよっ！\n甘いの食べたら、イケるっしょ！", "vo_minigame_1012_result_2102", 0, 22300170);
